USE mysql;
/**********************************************************/
/*                                                        */
/* Creacion de la estructura de la base de datos          */
/*                                                        */
/**********************************************************/


DROP   DATABASE IF EXISTS Cuidados_Paliativos_Panama;
CREATE DATABASE Cuidados_Paliativos_Panama
       DEFAULT CHARSET=utf8;
USE    Cuidados_Paliativos_Panama;


/*.........................................................Datos del Paciente...........................................................*/

	/*.................................................................
	  Estructura de Tabla: LETRAS_CEDULAS
	  Descripción:
	  El registro civil panameño compone la cédula de identidad de 4 
	  elementos: digito, letra, tomo y folio. La letra corresponde al
	  tipo de ciudadanía que posee la persona. Esta tabla define los
	  tipos de letras que se utilizan en la identificación de cédulas.
	  ................................................................*/
  
		DROP TABLE IF EXISTS LETRAS_CEDULAS;
		CREATE TABLE LETRAS_CEDULAS (
		  CED_LETRA                    VARCHAR(3) NOT NULL DEFAULT '00',
		  DESCRIPCION                  VARCHAR(25) NOT NULL,
		  PRIMARY KEY (CED_LETRA)
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;


		/*.................................................................
		  Datos de inicialización de la tabla LETRAS_CEDULAS
		  ................................................................*/
		  
			COMMIT;


	/*.................................................................
	  Estructura de Tabla: SEXO
	  Descripción:
	  Esta tabla maneja los tipo de sexo existentes
	  ................................................................*/
	  
		DROP TABLE IF EXISTS SEXO;
		CREATE TABLE SEXO (
		  ID_SEXO                     INT(11) NOT NULL,
		  SEXO                        VARCHAR(15) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY  (ID_SEXO)
		) ENGINE=INNODB DEFAULT CHARSET=utf8;
		
		
		/*.................................................................
		  Datos de inicialización de la tabla SEXO
		  ................................................................*/
		  
			COMMIT;


	/*.................................................................
	  Estructura de Tabla: ESTADOS_CIVILES
	  Descripción:
	  Esta tabla maneja los estados civiles más utilizados en relación
	  a la afinidad de asociación conyugal que puede tener un paciente.
	  ................................................................*/
	  
		DROP TABLE IF EXISTS ESTADOS_CIVILES;
		CREATE TABLE ESTADOS_CIVILES (
		  ID_ESTADO_CIVIL            INT(11) NOT NULL,
		  ESTADO_CIVIL               VARCHAR(15) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY (ID_ESTADO_CIVIL)
		) ENGINE=INNODB DEFAULT CHARSET=utf8;

		/*.................................................................
		  Datos de inicialización de la tabla ESTADOS_CIVILES
		  ................................................................*/
		  
			COMMIT;


	/*.................................................................
	  Estructura de Tabla: TIPOS_SANGUINEOS
	  Descripción:
	  Esta tabla maneja los datos relacionados a los tipos sanguíneos 
	  mas comunes entre los pacientes.
	  ................................................................*/
	  
		DROP TABLE IF EXISTS TIPOS_SANGUINEOS;
		CREATE TABLE TIPOS_SANGUINEOS (
		  ID_TIPO_SANGUINEO             INT(11) NOT NULL AUTO_INCREMENT,
		  TIPO_SANGRE                   VARCHAR(4) NOT NULL DEFAULT 'N/A',
		  PRIMARY KEY (ID_TIPO_SANGUINEO)       
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;

		/*.................................................................
		  Datos de inicialización de la tabla TIPOS_SANGUINEOS
		  ................................................................*/
		COMMIT;



	/*.................................................................
	  Estructura de Tabla: PROVINCIAS
	  Descripción:
	  Esta tabla proporciona los valores de distribución
	  política de Panamá en relación a las provincias
	  que existen actualmente. Estos datos sirven de apoyo
	  para efectos de localización geográfica en el sistema.
		  ................................................................*/
		  
		DROP TABLE IF EXISTS PROVINCIAS;
		CREATE TABLE PROVINCIAS (
		  ID_PROVINCIA                INT(11) NOT NULL DEFAULT 0,
		  PROVINCIA                   VARCHAR(20) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY  (ID_PROVINCIA)
		) ENGINE=INNODB DEFAULT CHARSET=utf8;
		
		/*.................................................................
		  Datos de inicialización de la tabla PROVINCIAS
		  ................................................................*/
		  
		COMMIT;




	/*.................................................................
	  Estructura de Tabla: DISTRITOS
	  Descripción:
	  Esta tabla proporciona los valores de distribución
	  política de Panamá en relación a los distritos
	  que existen actualmente. Estos datos sirven de apoyo
	  para efectos de localización geográfica en el sistema.
	  ................................................................*/
	  
		DROP TABLE IF EXISTS DISTRITOS;
		CREATE TABLE DISTRITOS (
		  ID_PROVINCIA                INT(11) NOT NULL,
		  ID_DISTRITO                 INT(11) NOT NULL,
		  DISTRITO                    VARCHAR(130) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY (ID_DISTRITO, ID_PROVINCIA),
		  INDEX ID_PROVINCIA (ID_PROVINCIA),
		  FOREIGN KEY (ID_PROVINCIA) REFERENCES PROVINCIAS (ID_PROVINCIA)
				  ON DELETE NO ACTION ON UPDATE CASCADE
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;
		
		/*.................................................................
		  Datos de inicialización de la tabla DISTRITOS
		  ................................................................*/
		  
		COMMIT;


	/*.................................................................
	  Estructura de Tabla: CORREGIMIENTOS
	  Descripción:
	  Esta tabla proporciona los valores de distribución
	  política de Panamá en relación a los corregimientos
	  que existen actualmente. Estos datos sirven de apoyo
	  para efectos de localización geográfica en el sistema.
	  ................................................................*/
	  
		DROP TABLE IF EXISTS CORREGIMIENTOS;
		CREATE TABLE CORREGIMIENTOS (
		  ID_PROVINCIA                INT(11) NOT NULL,
		  ID_DISTRITO                 INT(11) NOT NULL,
		  ID_CORREGIMIENTO            INT(11) NOT NULL,
		  CORREGIMIENTO               VARCHAR(130) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY ( ID_PROVINCIA, ID_DISTRITO, ID_CORREGIMIENTO),
		  INDEX ID_PROVINCIA (ID_PROVINCIA),
		  INDEX ID_DISTRITO (ID_DISTRITO),
		  FOREIGN KEY (ID_PROVINCIA) REFERENCES PROVINCIAS (ID_PROVINCIA)
				  ON DELETE NO ACTION ON UPDATE CASCADE,
		  FOREIGN KEY (ID_DISTRITO) REFERENCES DISTRITOS (ID_DISTRITO)
				  ON DELETE NO ACTION ON UPDATE CASCADE
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;
		
		
		/*.................................................................
		  Datos de inicialización de la tabla CORREGIMIENTOS
		  ................................................................*/
		   
		COMMIT;



	/*.................................................................
	  Estructura de Tabla: NACIONALIDADES
	  Descripción:
	  Esta tabla maneja los datos con las diferentes nacionalidades a 
	  las que un paciente puede pertenecer.
	  ................................................................*/
	  
		DROP TABLE IF EXISTS NACIONALIDADES;
		CREATE TABLE NACIONALIDADES (
		  ID_NACIONALIDAD               INT(11) NOT NULL AUTO_INCREMENT,
		  NACIONALIDAD                  VARCHAR(130) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY (ID_NACIONALIDAD) 
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;
		
		/*.................................................................
		  Datos de inicialización de la tabla NACIONALIDADES
		  ................................................................*/
		  
		COMMIT;
		
	
	/*.................................................................
	  Estructura de Tabla: ZONA
	  Descripción:
	  Esta tabla maneja las zonas o regiones determinadas por el ministerio de salud
	  ................................................................*/
		DROP TABLE IF EXISTS ZONA;
		CREATE TABLE ZONA (
		  ID_ZONA                 INT(11) NOT NULL AUTO_INCREMENT,
		  ZONA                     VARCHAR(30) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY (ID_ZONA)   
		 ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
		 
	/*.................................................................
	  Estructura de Tabla: ETNIA
	  Descripción:
	  Esta tabla maneja los datos relacionados a las categorias de pacientes que
	  maneja el sistema, si asegurados o no asegurados.
	  ................................................................*/
	  
		DROP TABLE IF EXISTS ETNIA;
		CREATE TABLE ETNIA (
		  ID_ETNIA                  INT(11) NOT NULL AUTO_INCREMENT,
		  ETNIA                     VARCHAR(30) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY (ID_ETNIA)   
		 ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
	/*.................................................................
	  Estructura de Tabla: TIPOS_PACIENTE
	  Descripción:
	  Esta tabla maneja los datos relacionados a las categorias de pacientes que
	  maneja el sistema, si asegurados o no asegurados.
	  ................................................................*/
	  
		DROP TABLE IF EXISTS TIPO_PACIENTE;
		CREATE TABLE TIPO_PACIENTE (
		  ID_TIPO_PACIENTE                  INT(11) NOT NULL AUTO_INCREMENT,
		  TIPO_PACIENTE                     VARCHAR(30) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY (ID_TIPO_PACIENTE)   
		 ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
		 
		/*.................................................................
		 Datos de inicialización de la tabla TIPOS_PACIENTE
		  ................................................................*/
		COMMIT;
		
		
		
	/*.................................................................
	 Estructura de Tabla: RESIDENCIA_HABITUAL
	 Descripción:
	 Esta tabla maneja los datos relacionados la dirección exacta del paciente
	................................................................*/
	
		DROP TABLE IF EXISTS RESIDENCIA_HABITUAL;
		CREATE TABLE RESIDENCIA_HABITUAL (
		  ID_RESIDENCIA_HABITUAL                INT(11) NOT NULL AUTO_INCREMENT,
		  ID_PROVINCIA           				INT(11) NOT NULL,           
		  ID_DISTRITO							INT(11) NOT NULL,
		  ID_CORREGIMIENTO            			INT(11) NOT NULL,
		  ID_ZONA           					INT(11) NOT NULL,
		  DETALLE								VARCHAR(200) NOT NULL DEFAULT 'POR DEFINIR',
		  PRIMARY KEY (ID_RESIDENCIA_HABITUAL),
		  FOREIGN KEY (ID_PROVINCIA) REFERENCES PROVINCIAS (ID_PROVINCIA)
				  ON DELETE NO ACTION ON UPDATE CASCADE, 
		  FOREIGN KEY (ID_DISTRITO,ID_PROVINCIA ) REFERENCES DISTRITOS (ID_DISTRITO,ID_PROVINCIA)
				  ON DELETE NO ACTION ON UPDATE CASCADE, 
		  FOREIGN KEY (ID_DISTRITO, ID_PROVINCIA, ID_CORREGIMIENTO) REFERENCES CORREGIMIENTOS (ID_DISTRITO,ID_PROVINCIA, ID_CORREGIMIENTO)
				  ON DELETE NO ACTION ON UPDATE CASCADE,
		  FOREIGN KEY (ID_ZONA) REFERENCES ZONA (ID_ZONA)
				  ON DELETE NO ACTION ON UPDATE CASCADE 
		 ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
		 
		 

	/*.................................................................
	  Estructura de Tabla: DATOS_PACIENTES

	  Descripción:

	  Esta tabla maneja los datos relacionados con los datos generales de 
	  los pacientes de la clinica y que son básicos para una atención 
	  mínima en la misma.
	  ................................................................*/
		DROP TABLE IF EXISTS DATOS_PACIENTES;
		CREATE TABLE DATOS_PACIENTES (
		  ID_PACIENTE                 INT(11) NOT NULL AUTO_INCREMENT, 
		  NO_CEDULA                   VARCHAR(20) NOT NULL,
		  SEGURO_SOCIAL               VARCHAR(20) DEFAULT 'POR DEFINIR',
		  PRIMER_NOMBRE               VARCHAR(20) NOT NULL,
		  SEGUNDO_NOMBRE              VARCHAR(20) DEFAULT 'POR DEFINIR',
		  APELLIDO_PATERNO            VARCHAR(20) NOT NULL DEFAULT 'POR DEFINIR',
		  APELLIDO_MATERNO            VARCHAR(20) NOT NULL,
		  ID_ESTADO_CIVIL             INT(11) NOT NULL,
		  ID_SEXO                     INT(11) NOT NULL, 
		  FECHA_NACIMIENTO            DATE NOT NULL,
		  LUGAR_NACIMIENTO            VARCHAR(100) NOT NULL,
		  EDAD_PACIENTE               INT(11) NOT NULL,
		  ID_ETNIA                    INT(11) NOT NULL,
		  ID_TIPO_SANGUINEO           INT(11) NOT NULL,
		  ID_NACIONALIDAD             INT(11) NOT NULL, 
		  ID_TIPO_PACIENTE			  INT(11) NOT NULL, 
		  TELEFONO_CASA               VARCHAR(10) DEFAULT NULL,
		  TELEFONO_CELULAR            VARCHAR(10) DEFAULT NULL,
		  E_MAIL                      VARCHAR(150) DEFAULT 'POR DEFINIR',
		  OCUPACION			          TEXT,
		  ID_RESIDENCIA_HABITUAL      INT(11) NOT NULL,    
		  RESIDENCIA_TRANSITORIA      TEXT,
		  NOMBRE_PADRE				  VARCHAR(75) NOT NULL,
		  NOMBRE_MADRE				  VARCHAR(75) NOT NULL,
		  PRIMARY KEY (ID_PACIENTE),
		  FOREIGN KEY (ID_ESTADO_CIVIL) REFERENCES ESTADOS_CIVILES (ID_ESTADO_CIVIL)
				  ON DELETE NO ACTION ON UPDATE CASCADE,          
		  FOREIGN KEY (ID_SEXO) REFERENCES SEXO (ID_SEXO)
				  ON DELETE NO ACTION ON UPDATE CASCADE, 
		  FOREIGN KEY (ID_ETNIA) REFERENCES ETNIA(ID_ETNIA)
				  ON DELETE CASCADE ON UPDATE CASCADE,
		  FOREIGN KEY (ID_TIPO_SANGUINEO) REFERENCES TIPOS_SANGUINEOS (ID_TIPO_SANGUINEO)
				  ON DELETE NO ACTION ON UPDATE CASCADE,                   
		  FOREIGN KEY (ID_NACIONALIDAD) REFERENCES NACIONALIDADES (ID_NACIONALIDAD)
				  ON DELETE NO ACTION ON UPDATE CASCADE,
		  FOREIGN KEY (ID_TIPO_PACIENTE) REFERENCES TIPO_PACIENTE (ID_TIPO_PACIENTE)
				  ON DELETE NO ACTION ON UPDATE CASCADE,
		  FOREIGN KEY (ID_RESIDENCIA_HABITUAL ) REFERENCES RESIDENCIA_HABITUAL  (ID_RESIDENCIA_HABITUAL)
				  ON DELETE NO ACTION ON UPDATE CASCADE			  
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;



/*.................................................................
  Estructura de Tabla: TRAZABILIDAD
  Descripción:
  Esta tabla maneja el concepto de la Trazabilidad para los productos
  resultantes de una consulta médica, tal que permita dar seguimientos
  a dichos elementos en forma de búsquedas en el sistema. Igualmente 
  sirve de de tabla de control y auditoría.
  ................................................................*/
DROP TABLE IF EXISTS TRAZABILIDAD;
CREATE TABLE TRAZABILIDAD (
  ID_TRAZABILIDAD               VARCHAR(36) NOT NULL,
  ID_PACIENTE                   INT(11) NOT NULL,
  FECHA                         DATE NOT NULL,  
  PRIMARY KEY (ID_TRAZABILIDAD),
  FOREIGN KEY (ID_PACIENTE) REFERENCES DATOS_PACIENTES (ID_PACIENTE)
          ON DELETE CASCADE ON UPDATE CASCADE 
) ENGINE=InnoDB DEFAULT CHARSET=utf8;









/*...........................................................DATOS DE SESIÓN.................................................*/		
	  
	  
	 
	  /*.................................................................
	  Estructura de Tabla: GRUPOS_USUARIOS
	  Descripción:
	  Esta tabla maneja las categorias de usuarios del
	  sistema. Con base en esta agrupación, se debe definir 
	  la intervención sobre los componentes y las operaciones
	  que se pueden hacer.
	  ................................................................*/
	  
			DROP TABLE IF EXISTS GRUPOS_USUARIOS;
			CREATE TABLE GRUPOS_USUARIOS (
			  ID_GRUPO_USUARIO          INT(11) NOT NULL AUTO_INCREMENT,
			  DESCRIPCION               VARCHAR(30) NOT NULL,
			  PRIMARY KEY (ID_GRUPO_USUARIO)
			) ENGINE=InnoDB DEFAULT CHARSET=utf8;

			/*.................................................................
			  Datos de inicialización de la tabla GRUPOS_USUARIOS
			  ................................................................*/
			COMMIT;

	   /*.................................................................
	   Estructura de Tabla: USUARIOS
	   Descripción:
	   El registro del perfil de cada usuario y sus datos
	   de referencia basicos se maneja en esta tabla.
	   Desde aqui se inicia la gestión del sistema.
		  ................................................................*/
	  
			DROP TABLE IF EXISTS USUARIOS;
			CREATE TABLE USUARIOS (
			  ID_USUARIO                INT(11) NOT NULL AUTO_INCREMENT,
			  ID_GRUPO_USUARIO          INT(11) NOT NULL,
			  CLAVE_ACCESO              VARCHAR(100) NOT NULL,
			  NO_IDENTIFICACION         VARCHAR(50) NOT NULL,
			  PRIMARY KEY (ID_USUARIO),
			  FOREIGN KEY (ID_GRUPO_USUARIO) REFERENCES GRUPOS_USUARIOS (ID_GRUPO_USUARIO)
					  ON DELETE NO ACTION ON UPDATE CASCADE  
			) ENGINE=InnoDB DEFAULT CHARSET=utf8;
			
	 
 /*.................................................................
	   Estructura de Tabla: PACIENTES	
	   Descripción:
	   Esta tabla maneja las preferencias de acceso y autenticación para 
	   el usuario.
	   ................................................................*/	
	   
			DROP TABLE IF EXISTS PACIENTES;
				CREATE TABLE PACIENTES (
				  ID_PACIENTE          INT(11) NOT NULL,
				  ID_USUARIO           INT(11) NOT NULL,
				  PRIMARY KEY (ID_PACIENTE),
				  FOREIGN KEY (ID_USUARIO) REFERENCES USUARIOS (ID_USUARIO)
					  ON DELETE NO ACTION ON UPDATE CASCADE	
				) ENGINE=InnoDB DEFAULT CHARSET=utf8;
			






	   /*.................................................................
	   Estructura de Tabla: PREFERENCIAS_RECUPERACION_ACCESO	
	   Descripción:
	   Esta tabla maneja las preferencias de acceso y autenticación para 
	   el usuario que ingresa al sistema y necesita ser notificado o 
	   validado para recuperación de su contraseña o similares.
	   ................................................................*/
	  
			DROP TABLE IF EXISTS PREFERENCIAS_RECUPERACION_ACCESO;
			CREATE TABLE PREFERENCIAS_RECUPERACION_ACCESO (
			  ID_USUARIO                     INT(11) NOT NULL,
			  USAR_PREGUNTA_SEGURIDAD        TINYINT(1) NOT NULL DEFAULT '0',
			  USAR_TELEFONO_PREFERENCIAL     TINYINT(1) NOT NULL DEFAULT '0',
			  USAR_E_MAIL_PREFERENCIAL       TINYINT(1) NOT NULL DEFAULT '0',
			  FOREIGN KEY (ID_USUARIO) REFERENCES USUARIOS (ID_USUARIO)
					  ON DELETE NO ACTION ON UPDATE CASCADE
			) ENGINE=INNODB DEFAULT CHARSET=utf8;

	  /*.................................................................
	  Estructura de Tabla: PREGUNTAS_SEGURIDAD	
	  Descripción:
	  Esta tabla maneja las distintas preguntas de seguridad para autenticar
	  el registro de un usuario que ingresa en el sistema.
	  ................................................................*/
	  
			DROP TABLE IF EXISTS PREGUNTAS_SEGURIDAD;
			CREATE TABLE PREGUNTAS_SEGURIDAD (
			  ID_PREGUNTA                 INT(11) NOT NULL AUTO_INCREMENT,
			  PREGUNTA                    TEXT,
			  PRIMARY KEY  (ID_PREGUNTA)
			) ENGINE=INNODB DEFAULT CHARSET=utf8;

			/*.................................................................
			  Datos de inicialización de la tabla PREGUNTAS_SEGURIDAD
			  ................................................................*/
			COMMIT;

	  /*.................................................................
	  Estructura de Tabla: DATOS_AUTENTICACION_USUARIO	
	  Descripción:
	  Esta tabla maneja los distintos datos de seguridad para autenticar
	  el registro de un usuario que se valida en el sistema.
	  ................................................................*/
			DROP TABLE IF EXISTS DATOS_AUTENTICACION_USUARIO;
			CREATE TABLE DATOS_AUTENTICACION_USUARIO (
			  ID_USUARIO                  INT(11) NOT NULL,
			  ID_PREGUNTA                 INT(11) NOT NULL,
			  RESPUESTA                   TEXT,
			  TELEFONO_PREFERENCIAL       VARCHAR(9) DEFAULT NULL,
			  E_MAIL_PREFERENCIAL         VARCHAR(150) DEFAULT 'POR DEFINIR',
			  FOREIGN KEY (ID_USUARIO) REFERENCES USUARIOS (ID_USUARIO)
					  ON DELETE NO ACTION ON UPDATE CASCADE,   
			  FOREIGN KEY (ID_PREGUNTA) REFERENCES PREGUNTAS_SEGURIDAD (ID_PREGUNTA)
					  ON DELETE CASCADE ON UPDATE CASCADE
			) ENGINE=INNODB DEFAULT CHARSET=utf8;

	   /*.................................................................
	   Estructura de Tabla: SESIONES_USUARIOS
	   Descripción:
	   El registro de las sesiones de cada usuario y sus datos 
	   de conexión basicos se maneja en esta tabla.
	   Desde aqui se puede hacer auditoria sobre el trafico 
	   de los usuarios. Los valores de esta tabla deben ser 
	   capturados tan pronto el usuario haga su acceso al sistema.
	   ................................................................*/
	   
			DROP TABLE IF EXISTS SESIONES_USUARIOS;
			CREATE TABLE SESIONES_USUARIOS (
			  ID_SESION                   INT(11) NOT NULL AUTO_INCREMENT,
			  ID_USUARIO                  INT(11) NOT NULL,
			  FECHA_SESION                DATETIME NOT NULL,
			  IP_USUARIO                  VARCHAR(25) NOT NULL,
			  PRIMARY KEY (ID_SESION),
			  FOREIGN KEY (ID_USUARIO) REFERENCES USUARIOS (ID_USUARIO)
					  ON DELETE NO ACTION ON UPDATE CASCADE
			) ENGINE=InnoDB DEFAULT CHARSET=utf8;
			


	/*.................................................................
	  Estructura de Tabla: RESPONSABLE_PACIENTE
	  Descripción:
	  Esta tabla maneja los datos relacionados a la persona que
	  proporciona los datos del paciente, en caso de que el mismo 
	  no se encuentre en condiciones de proporcionarlos.
	................................................................*/
  
		DROP TABLE IF EXISTS RESPONSABLE_PACIENTE;
		CREATE TABLE RESPONSABLE_PACIENTE(
		  ID_RESPONSABLE_PACIENTE       INT(11) NOT NULL AUTO_INCREMENT,
		  ID_PACIENTE					INT(11) NOT NULL,
		  NOMBRE_CONTACTO             	VARCHAR(30) NOT NULL DEFAULT 'POR DEFINIR',
		  APELLIDO_CONTACTO            	VARCHAR(30) NOT NULL DEFAULT 'POR DEFINIR',
		  PARENTESCO_CONTACTO         	VARCHAR(30) NOT NULL DEFAULT 'POR DEFINIR',
		  DIRECCION_CONTACTO			VARCHAR(150) NOT NULL DEFAULT 'POR DEFINIR',
		  TELEFONO_CONTACTO				VARCHAR(9) NOT NULL,	
		  PRIMARY KEY (ID_RESPONSABLE_PACIENTE), 
		  FOREIGN KEY (ID_PACIENTE) REFERENCES DATOS_PACIENTES (ID_PACIENTE)
			ON DELETE NO ACTION ON UPDATE CASCADE       
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;




 












			
/*...............................................DATOS DE INSTITUCION.....................................*/
	
	   /*.................................................................
	   Estructura de Tabla: TIPO_INSTITUCION
	   Descripción:
	   Esta tabla maneja los datos relacionados con los datos generales de 
	   los pacientes de la clinica y que son básicos para una atención 
	   mínima en la misma.
	   ................................................................*/

			DROP TABLE IF EXISTS TIPO_INSTITUCION;
			CREATE TABLE TIPO_INSTITUCION (
			  ID_TIPO_INSTITUCION          INT(11) NOT NULL AUTO_INCREMENT,
			  TIPO_INSTITUCION             VARCHAR(30) NOT NULL DEFAULT 'POR DEFINIR',  
			  DENOMINACION                 VARCHAR(30) NOT NULL DEFAULT 'POR DEFINIR',  
			  PRIMARY KEY ( ID_TIPO_INSTITUCION)
			) ENGINE=InnoDB DEFAULT CHARSET=utf8;
		
	   /*.................................................................
		Estructura de Tabla: INSTITUCION
		Descripción:
		Esta tabla maneja los datos relacionados con las instituciones 
		hospitalarias.
		................................................................*/
	  
			DROP TABLE IF EXISTS INSTITUCION;
			CREATE TABLE INSTITUCION (
			  ID_INSTITUCION       INT(11) NOT NULL AUTO_INCREMENT,
			  ID_PROVINCIA         INT(11) NOT NULL, 
			  ID_DISTRITO	       INT(11) NOT NULL, 
			  ID_CORREGIMIENTO     INT(11) NOT NULL, 
			  ID_TIPO_INSTITUCION  INT(11) NOT NULL, 
			  LUGAR		           VARCHAR(200) NOT NULL DEFAULT 'POR DEFINIR', 
			  DEPARTAMENTO         VARCHAR(200) NOT NULL DEFAULT 'POR DEFINIR', 
			  PRIMARY KEY (ID_INSTITUCION),
			  FOREIGN KEY (ID_PROVINCIA) REFERENCES PROVINCIAS (ID_PROVINCIA)
					  ON DELETE NO ACTION ON UPDATE CASCADE, 
			  FOREIGN KEY (ID_DISTRITO,ID_PROVINCIA ) REFERENCES DISTRITOS (ID_DISTRITO,ID_PROVINCIA)
					  ON DELETE NO ACTION ON UPDATE CASCADE, 
